import { Box } from '@mui/system';
import React from 'react';

const Profile=()=>{
    return (
        <div className='profile'>
            <Box sx={{ 
                position:"absolue",
                width:"100%",
                height:"100px",
                backgroundColor:"blueviolet",

            }}>
            </Box>
        </div>
    );
}
export default Profile;
